router.post('/send', async (ctx, next) => {
    const {
        user,
        token,
        type,
        appid,
        name,
        lname,
        version,
        mail,
        time,
        size,
        ccode,
        title,
        code,
        content,
        msg
    } = ctx.request.body
    console.log(new Date(), ctx.request.body)
    if (type === 'success') {
        await sendMailFun({
            user,
            token,
            appid,
            name,
            lname,
            version,
            mail,
            ccode,
            time,
            size,
            title
        })
    } else if (type === 'login') {
        await sendMailLogin({
            user,
            token,
            mail,
            title,
            code,
            content
        })
    } else {
        await sendMailFunFail({
            user,
            token,
            lname,
            version,
            ccode,
            mail,
            title,
            msg
        })
    }
    ctx.body = {code: 0}
})
module.exports = router
